import React from 'react';

const WelcomePage = ({ user }) => {
  return (
    <div style={{ textAlign: 'center' }}>
      <h2>Welcome!!, {user.email}</h2>
      <p>User ID: {user.id}</p>
    </div>
  );
};

export default WelcomePage;
